import React from "react";

function Resume() {
  return (
    <object
      width="400"
      height="500"
      type="application/pdf"
      data="/my_pdf.pdf?#zoom=85&scrollbar=0&toolbar=0&navpanes=0"
    >
      <p>Insert your error message here, if the PDF cannot be displayed.</p>
    </object>
  );
}
export default Resume;
